import React, { Component } from 'react';
import logo from './assets/logo.png';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          {/* <img src={logo} className="logo" alt="Dev London logo" /> */}
          {/* <p>Bringing the Forest City tech community together.</p> */}
          <h1>Bringing tech <span className="pop">together</span><br />in the <span className="pop">Forest City</span></h1>
          <div className="action-container">
            <button className="call-to-action primary">
              join the community
            </button>
            <button className="call-to-action tertiary">
              come to an event
            </button>
          </div>
        </header>
        <div className="body">things will live here</div>
      </div>
    );
  }
}

export default App;
